import React from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import AccountCircle from '@material-ui/icons/AccountCircle';
import Badge from "@material-ui/core/Badge";
import IconButton from "@material-ui/core/IconButton";
import GoogleLogin from "react-google-login";

export default function LoginForm(props) {
    const { onLoginGoogle } = props;
    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    const classes = {
        socialButton : {
            borderRadius: '50%',
            margin: "5",
            padding: "10"
        }
    }

    return (
        <div>
            <IconButton aria-label="show 17 new notifications" color="inherit">
                <Badge color="secondary">
                    <AccountCircle onClick={handleClickOpen} />
                </Badge>
            </IconButton>

            <div>
                <GoogleLogin
                    clientId='408019739663-36iqjm145hgs48nsqcjsa1nh9ehml9q8.apps.googleusercontent.com'
                    render={(props) => (
                        <div onClick={props.onClick} />
                    )}
                    onSuccess={result => {
                        onLoginGoogle(result);
                        console.log('result: ',result);
                    }}
                    onFailure={result => console.log(result)}
                    cookiePolicy={'single_host_origin'}
                />
            </div>
            <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
                <DialogTitle id="form-dialog-title">Login</DialogTitle>
                <DialogContent>
                    <TextField
                        autoFocus
                        margin="dense"
                        id="name"
                        label="Email Address"
                        type="email"
                        fullWidth
                    />
                    <TextField
                        autoFocus
                        margin="dense"
                        id="name"
                        label="Password"
                        type="password"
                        fullWidth
                    />
                    <DialogActions>
                        <Button onClick={handleClose} color="primary">
                            Login
                        </Button>
                        <Button onClick={handleClose} color="primary">
                            close
                        </Button>
                    </DialogActions>

                    <DialogContentText>
                        Social Login
                    </DialogContentText>
                    <div>
                        <Button className={classes.socialButton} variant="outlined">
                            N
                        </Button>
                        <Button className={classes.socialButton} variant="outlined" color="primary">
                            F
                        </Button>
                        <Button className={classes.socialButton} variant="outlined" color="secondary">
                            G
                        </Button>
                        <Button className={classes.socialButton} variant="outlined" color="primary">
                            K
                        </Button>
                    </div>
                </DialogContent>
            </Dialog>
        </div>
    );
}
